import React,{Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div>   
        <div class="page-header">
          <div className="topheader">
            <div className="linkheader">
              <a href="#">tiet kiem hon voi ung dung</a>
              <a href="#">ban hang cung lazada</a>
              <a href="#">cham soc khach hang</a>
              <a href="#">kiem tra don hang</a>
              <a href="#">dang nhap</a>
              <a href="#">dang ky</a>
              <a href="#">change language</a>
            </div>
          </div>
          <div className="mainheader">
              <div className="searchheader">
                  <img src="./asset/img/logo.png" alt="lazada.com" width="127px" height="40px" />
                  <input type="text" placeholder="Tim kiem tren lazada"></input>
                  <button><i class="fas fa-search"></i></button>

                  <img src="asset/img/cart.png"  alt="" />

              </div>
          </div>
        </div>

      </div>
    );
  }
}

export default App;
